import styled from "styled-components";

export const Layout = () => {
  return (
    <Fragment>
      <BodyLayout>{children}</BodyLayout>
    </Fragment>
  );
};

export const BodyLayout = styled.div`
  border: 1px solid;
  background-color: #fff;
`;
